(32922, 8175, 'Marvin Katz', 'marvkatz@hotmail.com', '', '71.196.61.142', '2013-10-31 08:36:05', '2013-10-31 12:36:05', 'I had madico wondow film put on in my home. I find that the product does not eliminate much glare nor heat.  The company I used was 50% discount window tinting did a sloppy jpb of installatipn.  I called the company and was told that they were going to send a rep. To look at the problem. So far I am still waiting.  I hope the company stands by thier warranty.', 0, '0', 'Mozilla/5.0 (Linux; U; Android 4.1.2; en-us; LG-P769 Build/JZO54K) AppleWebKit/534.30 (KHTML, like Gecko) Version/4.0 Mobile Safari/534.30', '', 0, 0),
